const user = {
  name: 'Oleg Vasyl',
  age: 18,
};

function App() {
  return (
    <div className="App">
      <p>{user.age > 16 ? 'Hello)' : 'By('}</p>
      <>{Product(user)}</>
      <span>some text</span>
      <label htmlFor="input-form">Kababra</label>
      <input id="input-form" placeholder="do text" />
    </div>
  );
}

const Product = (props) => (
  <div>
    <h2>{props.name}</h2>
  </div>
);

export default App;
